.tl_table {
  position: relative;
  // height: 100%;
  // .table_box{
  //   height:calc(100% - 130px);
  // }
  .expandTitle {
    color: #333;
    font-size: 16px;
    margin: 10px 0;
    display: block;
    width: 100% !important;
    min-width: 100%;
  }
  .cell{
    max-width: 100%;
    /* overflow:hidden;
    text-overflow:ellipsis;
    white-space:nowrap; */
    img {
      display: block;
      margin: 0 auto;
    }
  }
  .red {
    color: #F56C6C !important;
  }
  .green {
    color: #67C23A !important;
  }
  .oper_warpper {
    user-select: none;
    .oper_item {
      margin-right: 10px;
      display: inline-block;
      &:last-child {
        margin-right: 0;
      }
    }
    .dropdown_link {
      font-size: 12px;
    }
  }
  .link_btn {
    cursor: pointer;
    margin-right: 10px;
    color: #1e71f9;
    &:hover {
      text-decoration: underline;
    }
    &:last-child {
      margin-right: 0;
    }
  }
  .table_expand {
    font-size: 0;
  }
  .table_icon {
    color: #85C2FF;
    font-size: 22px;
    &:hover {
      color: #1989FA;
      text-decoration: none;
    }
  }
  .table_expand label {
    min-width: 90px;
    color: #99a9bf;
  }
  .table_expand .el-form-item {
    margin-right: 0;
    margin-bottom: 0;
    min-width: 50%;
  }
  .tl_page {
    text-align: center;
    height: 60px;
    padding-top: 20px;
    background: #fff;
  }
  // 排序 --- start
  .el-table .caret-wrapper {
    height: 22px;
    margin-top: -3px;
  }
  .el-table .ascending .sort-caret.ascending {
    border-bottom-color: #409EFF;
  }
  .el-table .sort-caret.ascending {
    top: 0;
  }
  .el-table .sort-caret.descending {
    bottom: 0;
  }
  .el-table .descending .sort-caret.descending {
    border-top-color: #409EFF;
    bottom: 0;
  }
  .el-table .descending .sort-caret.descending{
    border-bottom-color: #fff;
  }
  // 排序 --- end
}
.el-table .cell.el-tooltip {
  white-space: initial;
}
.ellipsis {
  width:101%;
  display: -webkit-box;
  -webkit-line-clamp: 2;
  overflow: hidden;
  -moz-box-orient: vertical;
  -webkit-box-orient: vertical;
}
